import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for video items to load
    await page.waitForSelector('.video-item');

    // Count the number of visible video items
    const videoItemsCount = await page.$$eval('.video-item', items => items.length);

    // Log the count to the console
    console.log(`Total visible video items: ${videoItemsCount}`);

    // Take a screenshot after counting
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_counting.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_counting.png'));

    return {
      success: true,
      action: "Counted the total number of visible video items on the homepage",
      extractedData: { videoItemsCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

